import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import "./myStyle.css";
import Home from "./Components/home"
import jquery from "jquery";
window.$ = window.jQuery = jquery;
require("bootstrap");

function App() {
  return (
    <React.Fragment>
      <Home/>
    </React.Fragment>
  );
}

export default App;
